	@Test
	public void salvaAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio() {
		SalvaAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio req = new SalvaAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio();
		
		req.setAnnoBilancio(Integer.valueOf(2021));
		req.setDataOra(new Date());
		req.setRichiedente(getRichiedenteByProperties("consip", "regp"));
		req.setAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio(create(AccantonamentoFondiDubbiaEsigibilitaAttributiBilancio.class, 0));
		
		req.getAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio().setBilancio(create(Bilancio.class, 144));
		req.getAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio().setAccantonamentoGraduale(new BigDecimal("100"));
		req.getAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio().setQuinquennioRiferimento(2020);
		req.getAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio().setRiscossioneVirtuosa(Boolean.TRUE);
		req.getAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio().setStatoAccantonamentoFondiDubbiaEsigibilita(StatoAccantonamentoFondiDubbiaEsigibilita.BOZZA);
		req.getAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio().setTipoAccantonamentoFondiDubbiaEsigibilita(TipoAccantonamentoFondiDubbiaEsigibilita.PREVISIONE);
		
//		req.getAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio().setCreditiStralciati(new BigDecimal("0"));
//		req.getAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio().setCreditiStralciatiFcde(new BigDecimal("0"));
//		req.getAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio().setAccertamentiAnniSuccessivi(new BigDecimal("0"));
//		req.getAccantonamentoFondiDubbiaEsigibilitaAttributiBilancio().setAccertamentiAnniSuccessiviFcde(new BigDecimal("0"));
		
		SalvaAccantonamentoFondiDubbiaEsigibilitaAttributiBilancioResponse res = salvaAccantonamentoFondiDubbiaEsigibilitaAttributiBilancioService.executeService(req);
		assertNotNull(res);
	}
